import React from 'react';
import { Form, FormControl, FormGroup, FormLabel } from 'react-bootstrap';
function ActivityForm() {
	return (
		<Form>
			<FormGroup>
                <FormControl />
				<FormLabel>Activity title</FormLabel>
			</FormGroup>
		</Form>
	);
}
export default ActivityForm;
